import { useState } from "react";
const Book = () => {
  const [clickedCategories, setClickedCategories] = useState({
    A: false,
    B: false,
    C: false,
    D: false,
  });
  const [cars, setCars] = useState([]);
  const handleCategoryChange = (event) => {
    const selectedCategory = event.target.value;
    console.log(selectedCategory);

    setClickedCategories((prevValue) => ({
      ...prevValue,
      [selectedCategory]: true,
    }));
  };
  const handleChange = (e) => {
    if (e.target.value === "A" && clickedCategories.A) {
      setCars(["A", "B", "C"]);
      console.log("hello");
    }
  };
  const handleEvent = (e) => {
    handleChange(e);
    handleCategoryChange(e);
  };
  return (
    <div className="book">
      <div className="book-topic-cont">
        <h1>Book a car</h1>
      </div>
      <div className="book-cont2">
        <div className="select-cont1">
          <div className="topic">
            <img src="category.png" alt="" />
            <p>
              Select Vehicle Category<b>*</b>
            </p>
          </div>
          <select
            className="box"
            onChange={handleEvent}
          >
            <option>Select Vehicle Category</option>
            <option value="A">Car</option>
            <option value="B">SUV/MUV</option>
            <option value="C">Track</option>
            <option value="D">Van</option>
          </select>
        </div>
        <div className="select-cont2">
          <div className="topic">
            <i class="fa-solid fa-car-side"></i>
            <p>
              Select Your Car<b>*</b>
            </p>
          </div>
          <select className="box">
            <option>Select Your Car</option>
            {cars.map((car, index) => (
              <option key={index}>{car}</option>
            ))}
          </select>
        </div>
        <div className="select-cont3">
          <div className="topic">
            <i class="fa-solid fa-car-side"></i>
            <p>
              Select Your Car Type<b>*</b>
            </p>
          </div>
          <select name="cars" id="kj" className="box">
            <option value="car1">car1</option>
            <option value="car2">car2</option>
          </select>
        </div>
      </div>
      <div className="book-cont3">
        <div className="select-cont4">
          <div className="topic">
            <i class="fa-solid fa-car-side"></i>
            <p>
              Select Your Car Type<b>*</b>
            </p>
          </div>
          <select className="box"></select>
        </div>
        <div className="select-cont5">
          <div className="topic">
            <i class="fa-solid fa-car-side"></i>
            <p>
              Select Your Car Type<b>*</b>
            </p>
          </div>
          <select className="box"></select>
        </div>
        <div className="select-cont6">
          <div className="topic">
            <i class="fa-solid fa-car-side"></i>
            <p>
              Select Your Car Type<b>*</b>
            </p>
          </div>
          <select className="box"></select>
        </div>
      </div>
      <div className="search">
        <p>Search</p>
      </div>
    </div>
  );
};

export default Book;
